import requests as request

cookie = "_|WARNING:-DO-NOT-SHARE-THIS.--Sharing-this-will-allow-someone-to-log-in-as-you-and-to-steal-your-ROBUX-and-items.|_"

def get_game_info(id):
    endpoint = "https://games.roblox.com/v1/games/multiget-place-details?placeIds="+id
    return request.get(
        url=endpoint,
        cookies={
            ".ROBLOSECURITY": cookie
        }
    ).json()[0]